import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Form, Row, Col, Layout } from 'antd';
import { Icon } from '@iconify/react';
import threeDots from '@iconify/icons-bi/three-dots';
import '../Styles/FormHome.css';
import 'antd/dist/reset.css';

const { Header } = Layout;

const Home = () => {
  return (
    <div style={{backgroundColor: '#111111', minHeight: '100vh', display: 'flex', flexDirection: 'column', justifyContent: 'space-between'}}>
      <Icon icon={threeDots} />
        <div style={{ textAlign: 'center', padding: '2rem 0' }}>
            <img src="https://cdn-icons-png.flaticon.com/512/3664/3664541.png" alt="HomeImage" className='HomeImage' style={{ maxWidth: '100%', height: 'auto' }} />
            <p className='Welcome'>Bienvenido</p>
        </div>
      <Row justify="center" align="middle" style={{ flexGrow: 1, padding:'24px'}}>
        <Col xs={24} sm={16} md={12} lg={8}>
          <Form layout="vertical" style={{padding: '1rem', borderRadius: '30px'}}>
            <Form.Item style={{marginTop: '10px'}}>
              <Link to="/#">
                <Button className='Buttons' block>
                    <p>Iniciar sesión</p>
                </Button>
              </Link>
            </Form.Item>
            <Form.Item style={{marginTop: '10px'}}>
              <Link to="/RegistrarAjustador">
                <Button className='Buttons' block>
                  <p>Registrarse</p>
                </Button>
              </Link>
            </Form.Item>
          </Form>
        </Col>
      </Row>
      <Layout>
        <Header style={{ backgroundColor: '#222222',textAlign: 'center', color:'white', padding: '1rem 0' }}>
          Cesvi Mexico ©
        </Header>
      </Layout>
    </div>
  );
};

export default Home;
